void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = (fragCoord * 2.0 - iResolution.xy)/iResolution.y;
    float dick = abs(cos(cos(uv.x*10.))*sin(uv.x)/uv.y*iTime);
    float butt = abs(cos(uv.x)/(sin(uv.y)/uv.x));
     butt *= sqrt(-3.1414);

    float yum = (dick-cos(butt)*10.);


    float byum = pow(yum,-1.);

    // Time varying pixel color
    vec3 col = cos(yum+vec3(2,1,byum));

    // Output to screen
    fragColor = vec4(col,1.0);
}
